import React from 'react';
import "./Header.css";
import backgroundImage from "../../assets/background.jpg"

const Header = () => {
  return (
    <>
    <header className="header">
      <h1>ReactMeals</h1>
      
    </header>
    <div className="main-image">
      <img src={backgroundImage} alt='background Image' />
    </div>
  </>
  )
}

export default Header
